@keyframes pulse {
  0% {
    stroke-width: 2;
  }
  50% {
    stroke-width: 8;
  }
  100% {
    stroke-width: 2;
  }
}
.clearCatcher {
  fill-opacity: 0;
  width: 100%;
  height: 100%;
}
.legend .navArrow {
  fill: #333333;
  cursor: pointer;
  /* stroke enabled for a bigger click target, but smaller visible arrow size */
  stroke: #FFF;
  stroke-width: 2px;
}
.data-labels {
  font-size: 12px;
  text-anchor: middle;
  font-family: helvetica, arial, sans-serif;
  pointer-events: none;
}
.circleLine .text {
  line-height: 1;
  font-weight: 12;
}
svg.asterPlot {
  position: absolute;
}
.asterSlice:focus,
.asterSlice:focus-visible {
  outline: none;
}
.asterSlice:focus-visible {
  filter: drop-shadow(0 0 5px rgba(0, 0, 0, 0.5));
  animation: pulse 1s infinite;
}
